import React, { PureComponent } from "react";
import { Outlet, Link } from "react-router-dom";
import "../styles/listing.css";

class Listing extends PureComponent {
  render() {
    let productsAll = this.props.state.productsClothes;
    console.log(productsAll);
    return (
      <ul className="listing-container">
        {productsAll.map((item) => (
          <li className="listing" key={item.name}>
            <div className="listing-image-box">
              <img src={item.gallery[0]} className="listing-image"></img>
            </div>
            <div className="listing-title">{item.name}</div>
            <div className="listing-price">{item.prices[0].currency.symbol}{item.prices[0].amount}</div>
          </li>
        ))}
      </ul>
    );
  }
}

export default Listing;
